import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="bg-indigo-600 text-white p-4">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-xl font-bold">
          Career Predictor
        </Link>
        <div className="space-x-6">
          <Link to="/resume-builder" className="hover:text-indigo-200">
            Resume Builder
          </Link>
          <Link to="/resume-analysis" className="hover:text-indigo-200">
            Resume Analysis
          </Link>
          <Link to="/hie" className="hover:text-indigo-200">
            HIE
          </Link>
          <Link to="/career-prediction" className="hover:text-indigo-200">
            Career Prediction
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
